CREATE PROCEDURE [dbo].[spDeleteOutletGroup]
(
	@Id nvarchar(128)
)
AS

Begin
	DECLARE @RoleId NVARCHAR(128);
	Select @RoleId from Roles where Name Like @RoleName;

	Delete from [UserRole(RS)] 
    WHERE UserId = @UserId And RoleId = @RoleId;
END

CREATE PROCEDURE [dbo].[spDeleteRole]
(
	@UserId nvarchar(128),
	@RoleName nvarchar(128)
)
AS

CREATE PROCEDURE [dbo].[spDeleteUser]
(
	@Id nvarchar(128)
)
AS

	SELECT u.* from Users u INNER JOIN [UserRole(RS)] ur ON ur.UserId = u.Id INNER JOIN 
	roles r ON r.Id = ur.RoleId WHERE r.Name = @RoleName;
RETURN 0

